      News
    </Typography>
  </Toolbar>
</AppBar>
      <h2>Let&apos;s make this look way better with Material-UI, eh?</h2>
      <table>
        <tbody>
          {emails.map((email) => (
            <tr key={email.id}>
              <td>{email.from}</td>
              <td>{email.subject}</td>
              <td>{email.received}</td>
              <td>{email.trash ? 'Trash' : 'Inbox'}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
